import PropTypes from 'prop-types';

const LinkButton = props => {
    const { children, className, ...linkButtonProps } = props;
    return (
        <button className={`text-indigo-500 font-medium ${className}`} {...linkButtonProps}>
            {children}
        </button>
    );
};

LinkButton.propTypes = {
    classname: PropTypes.string,
};

export default LinkButton;
